import React, { useEffect, useState } from 'react';
import { makeStyles } from '@mui/styles';
import TextField from '@mui/material/TextField';
import { Container ,Paper,Button} from '@mui/material';
import { FilledInput, FormControl, IconButton, Input, InputAdornment, InputLabel } from "@mui/material";
import { VisibilityOffOutlined, VisibilityOutlined } from "@mui/icons-material";

const useStyles = makeStyles((theme) => ({
  // root: {
  //   '& > *': {
  //     margin: theme.spacing(1),
  //   },
  // },
}));

export default function Student() {
    const paperStyle={padding:'50px 20px', width:600,margin:"20px auto"}
    const[name,setName]=useState('')
    const[address,setAddress]=useState('')
    const[password,setPassword]=useState([])
    const[students,setStudents]=useState([])
    const [psw, setPsw] = useState(false);
    const handleShowPsw = () => setPsw((show) => !show);
    const handleHidePsw = (e) => {
      e.preventDefault();
   };
    const classes = useStyles();

  const handleClick=(e)=>{  
    e.preventDefault()
    const student={name,address}
    console.log(student)
    fetch("http://localhost:8080/authorization/addStudent",{
      method:"POST",
      headers:{"Content-Type":"application/json"},
      body:JSON.stringify(student)

  }).then(()=>{
    console.log("New Student added")
  })

}

useEffect(()=>{
  fetch("http://localhost:8080/authorization/getAllStudents")
  .then(res=>res.json())
  .then((result)=>{
    console.log('Fetched students:', result); // Dodaj t
    setStudents(result);
  }
).catch(error => console.error('Error fetching students:', error));
},[])
  return (

    <Container>
        <Paper elevation={3} style={paperStyle}>
            <h1 style={{color:"blue"}}><u>Zarejestruj siÄ™</u></h1>

    <form className={classes.root} noValidate autoComplete="off">

      <TextField id="outlined-basic" label="Student Name" variant="outlined" fullWidth 
      value={name}
      onChange={(e)=>setName(e.target.value)}
      />
      <TextField id="outlined-basic" label="email addres" variant="outlined" fullWidth
      value={address}
      onChange={(e)=>setAddress(e.target.value)}
      />
      <FilledInput
              value={password}
              onChange={(e)=>setPassword(e.target.value)}
              type={psw ? 'text' : 'password'}
              fullWidth
              endAdornment={
                  <InputAdornment position="start">
                     <IconButton
                        onClick={handleShowPsw}
                        onMouseDown={handleHidePsw}
                        edge="end"
                     >
                        {psw ? <VisibilityOffOutlined /> : <VisibilityOutlined />}

                     </IconButton>

                  </InputAdornment>
               }
            />
       <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
      <Button variant="contained" color="secondary" onClick={handleClick}>
        Zarejestruj
      </Button>
    </div>
    </form>

    </Paper>
    <h1>Students</h1>
{
    <Paper elevation={3} style={paperStyle}>

      {students.map(student=>(
        <Paper elevation={6} style={{margin:"10px",padding:"15px", textAlign:"left"}} key={student.id}>
         Id:{student.id}<br/>
         Name:{student.name}<br/>
         Address:{student.address}

        </Paper>
      ))
}
    </Paper> }
    </Container>
  );
}
